-- *************************************************************************
-- * Script que crea y carga datos en las tablas educacion y universidades *
-- *************************************************************************

-- *********************
-- ** Tabla educacion **
-- *********************


CREATE TABLE public.educacion
(
    id integer,
    geom geometry,
    nombre character varying(200),
    direccion character varying(100),
	nivel character varying(254),
    barrio character varying(254),
    comuna double precision,
	area_prog character varying(60),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.educacion
    OWNER to postgres;




-- *************************
-- ** Tabla universidades **
-- *************************


CREATE TABLE public.universidades
(
    id integer,
    geom geometry,
    nombre character varying(200),
    regimen character varying(60),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.universidades
    OWNER to postgres;


